import React from 'react';
import {Container, Row} from 'react-bootstrap'
import ContactA from './ContactA';

const AllContact = (props) => {
    return (
        <div>
            <Container>
                <Row>
                    {
                    props.AllContactData.map((item) => {
                        return (
                                <ContactA
                                key = {item.id}
                                contactBio = {item}
                                delete = {props.delete}
                                editContact = {props.editContact}
                                /> 
                        );
                    })
                    } 
                </Row>
            </Container>
        </div>
    );
}

export default AllContact;
